        {
              Artist:"Anuv Jain",
              price:"650",
              date:"20/12/2023",
              Venue:"Jaipur",
              backgroundImage:"images/artist/anuv.jpeg",
              state:false
        
        },

       {   
              Artist:"King",
              price:"1300",
              date:"9/12/2023",
              Venue:"Delhi",
              backgroundImage:"images/artist/king.jpeg",
              state:false
        },

       {
