             date:"31/12/23",
             Venue:"Mumbai",
             backgroundImage:"images/artist/weeek.jpeg",
             state:false},

        {
             Artist:"Coldplay",
             price:"10000",
             date:"06/05/2024",
             Venue:"Goa",
             backgroundImage:"images/artist/cold.jpeg",
             state:false},
        {
             Artist:"Ed Sheeran",
             price:"950",
             date:"21/03/2023",
             Venue:"Delhi",
             backgroundImage:"images/artist/Ed.jpeg",
             state:false},

    ];

    const [endresult, setEndresult] = useState(a);
   

    return( 
        <div>
                
            {
            endresult.map((x,index)=>(
                <Event name={x.Artist} price={x.price} date={x.date} Location={x.Venue} backgroundImage={x.backgroundImage}/>
              
            ))
            }  
        </div>
    );
}
        
export default Event1;
